import './App.scss';

const dog =['suo', 'sunius','Bobikas','Kudliis','sarikas','Itonas'];




function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Props</h1>
        <div className='dog-bin'>
          {
            dog.map((d, i)=> <div key={i} className={'dog'+ (i % 2 ? 'sq': 'cc')} >{d}</div>)
          }
        </div>
        
  
      </header>
    </div>
  );
}

export default App;
